/**
 * Different types of Bar.
 * @public
 */
enum ViewSettingsDialogMode {
	/**
	 * Default type
	 * @since 1.0.0-rc.16
	 * @public
	 */
	Sort = "Sort",

	/**
	 * Filter type
	 * @since 1.0.0-rc.16
	 * @public
	 */
	Filter = "Filter",
}

export default ViewSettingsDialogMode;
